import Cats from './views/AllCats';
import { Link, Navigate, Route, Routes} from 'react-router-dom';
// import GlobalStyle from './globalStyles';
// import  EditCat  from './views/EditCat';
// import Cat from './views/OneCat';
import  CatCity  from './views/CatCity';
import { NewCat } from './views/NewCat';
import { NotFound } from './views/NotFound';


function App() {
  return (
    <div className="App ">
      <nav className="navbar bg-secondary navbar-expand-lg sticky-top justify-content-around">
          <Link
            to="/cats"
            className="btn navbar-brand"
          >
            only<em>Cats</em>
          </Link>



        <div className="navbar-nav bg-secondary justify-content-between ">
          <Link
              to="/cats/new"
          >
            <img src="images\new_post.png" alt="add new" className="add-icon "/>
          </Link>

          <div class="dropdown">
            <button class="dropbtn">Dropdown
              <i class="fa fa-caret-down"></i>
            </button>
            <div class="dropdown-content">
              <a href="#">Link 1</a>
              <a href="#">Link 2</a>
              <a href="#">Link 3</a>
            </div>
            </div>

          <img src='images\cat.png' className='icons bg-secondary nav-icon mb-0 '/>

        </div>
      </nav>

  {/* FRONT END ROUTES to display VIEWS */}
  {/* SEPERATTE FROM SERVER ROUTES */}
  <Routes>
        {/* Redirect example */}
        <Route path="/" element={<Navigate to="/cats" />} />
        <Route path="/cats" element={<Cats />} />
        <Route path="/cats/:city" element={<CatCity />} />
        {/*<Route path="/cats/:id/edit" element={<EditCat />} />*/}
        <Route path="/cats/new" element={<NewCat />} /> 
        <Route path="*" element={<NotFound />} />
      </Routes>

    </div>
  );
}

export default App;
